script: |
  super -f text -I q1131.spq | sort > q1131.out

inputs:
  - name: q1131.spq
    data: |
      SELECT DISTINCT col1 FROM tab0 (FORMAT parquet) WHERE col1 IS NOT NULL OR NOT ( NOT NULL NOT IN ( 58, - col0 + col1 + - CAST ( NULL AS INTEGER ) ) );
  - name: tab0

outputs:
  - name: q1131.out
    data: |
      1
      21
      81
